import React from 'react';
import {Link} from "react-router-dom";
import 'App.css';

const BoardList = (props) => {
  return(
    <ul className="list_board">
      { props.list.map((board, index) => (
        <li key={index}>
          <Link to="/" className="list_board">
            <div>
              <h1>{board.title}</h1>
            </div>
          </Link>
        </li>
      ))  }
    </ul>
  );
}

export default BoardList;
